import React from "react";
import badge from "./badge.svg";
import circle from "./circle.svg";
import {
  PageWrapper,
  Image,
  Circle,
  TopText,
  BottomText,
} from "./Complete.style";
import Confetti from "../../global/confetti/Confetti";

const Complete = (props) => {
  return (
    <>
      {/* <Confetti /> */}
      <TopText>Mission one</TopText>
      <PageWrapper>
        <Circle src={circle} />
        <Image src={badge} />
      </PageWrapper>
    </>
  );
};

export default Complete;
